    def get_data_by_oit(self, data_name: str, oit: str = None):
        """
        The function check's if given data set per OIT presents in class and return it, other-vice return default data set

        :param data_name: a part of data set name, usually named same as related api endpoint (post_action for ex.)
        :param oit: name of the order item type with underscore separator ('Marriage_License' for ex.)
        :return: the link on found data set
        """

        oit = None if oit == 'Default' else oit

        if oit and hasattr(self, f"{data_name}_{oit}_data"):
            return getattr(self, f"{data_name}_{oit}_data")
        return getattr(self, f"{data_name}_data")
